import React, { Component } from 'react';
import CookiesPolicy from '../components/Legal/CookiesPolicy';

export class Cookies extends Component {
    render() {
        return (
            <div>
                <CookiesPolicy/>
            </div>
        )
    }
}

export default Cookies
